import "../css/CardConvert.css";
import {
  Box,
  Card,
  CardContent,
  Typography,
  CardActions,
  Button,
  TextField,
} from "@material-ui/core";
import { shadows } from "@mui/system";
import Paper from "@mui/material/Paper";
function CardConvert(title_msg,input_msg,onConvert,output_msg) {
  return (
    <Box variant="outlined" className="box" sx={{ shadows: 40 }}>
      <Card elevation={20} sx={{ shadows: 40 }} className="main_card">
        <CardContent>
          <Typography variant="h5" color={"#34d2d8"} className="msg">
            {title_msg}
          </Typography>
          <div className="card_input">
            <TextField
              className="tf"
              id="outlined-basic"
              label="$"
              variant="outlined"
            />
            <span style={{ padding: "10px" }}></span>
            <Button 
              size="large"
              style={{
                padding: "10px",
                backgroundColor: "skyblue",
                textAlign: "center",
              }}
              color="blue">
              Convert
            </Button>
          </div>
          <CardActions className="ca">
            <Paper elevation={20} className="paper">
              Data
            </Paper>
          </CardActions>
        </CardContent>
      </Card>
    </Box>
  );
}
export default CardConvert;
